require 'time'

def run(input)
  shortest = ('a'..'z').map do |l|
    s = input.gsub(/#{l}/i, '')
    loop {
      n = remove_pairs(s)

      if s == n
        break
      else
        s = n
      end
    }

    s.length
  end.min
end

def remove_pairs(string)
  s = string

  ('a'..'z').map do |letter|
    s = s.gsub("#{letter}#{letter.upcase}", '').gsub("#{letter.upcase}#{letter}", '')
  end

  s
end

test_cases = [
  ['dabAcCaCBAcCcaDA', 4]
]

test_cases.each do |input, output|
  raise "Test case failed:" if run(input) != output
end

lines = DATA.read.chomp
puts run(lines)

